import React from 'react';

const Skills = () => {
  return (
    <div style={{
      padding: '2rem',
      backgroundColor: '#f4f4f9',
      borderRadius: '8px',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
      textAlign: 'center'
    }}>
      <h2 style={{
        fontSize: '1.8rem',
        color: '#333',
        marginBottom: '1rem'
      }}>My Skills</h2>
      {/* Add your skills content here */}
    </div>
  );
};

export default Skills;
